    render() {
        console.log(this.props.showIcon)

        return (


            <AppBar position="static" color={this.props.color}>
                <div className="header-container">

                    {this.props.showIcon &&

                        <div>
                            <Menu />
                        </div>
                    }
                    <div className="header">
                        <p className="title"> Portal de Not√≠cias</p>
                    </div>

                </div>
            </AppBar>
        )
    }
}


export default Header;
